INSERT INTO `media` (`no`, `category`, `name`, `email`, `title`, `contents`, `filename`, `filename_org`, `filename2`, `filename2_org`, `filename3`, `filename3_org`, `registdate`, `readno`, `display`, `top`, `newicon`, `link1`, `link2`, `link3`) VALUES
	(2, 2, NULL, NULL, '2015년 사회적기업가 육성사업 최종합격팀 발표', '<p>​앤톡이 2015년 사회적기업진흥원 사회적 기업가 육성사업 5기에 최종 선발되었습니다.<span id="husky_bookmark_end_1555017511793"></span>&nbsp;</p><p><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a90804a252b7059535.jpg"></p><p>&nbsp;</p><p>​<img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a908050fead7662427.jpg">​</p><p>&nbsp;</p>', '1555017603209_428.jpg', '59a90804a252b7059535.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:18:55', 0, NULL, NULL, NULL, 'http://www.pplkorea.org/social_entreprener.php', '', ''),
	(3, 2, NULL, NULL, '2016 H-온드림 오디션 1차 서류심사 및 2차 업종예선 합격', '<p style="text-align: center;" align="center">앤톡이 1차 서류심사와 2차 업종예선을 넘어 H-온드림 오디션 본선 무대에 진출했습니다!&nbsp;</p><p style="text-align: center;" align="center"><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a9090c2ee6b5513340.png"></p><p style="text-align: center;" align="center">&nbsp;</p><p style="text-align: center;" align="center">​&lt;앤톡의 박재준 대표가 H-온드림 오디션 본선 무대에서 발표하는 장면&gt;</p><p style="text-align: center;" align="center"><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a90a86131362544254.jpg">​</p><p style="text-align: center;" align="center">​&lt;기업들의 발표 후 대학생 투표단의 인기투표에서 당당하게 1등을 차지한 앤톡!&gt;</p><p style="text-align: center;" align="center"><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a90a86e2af45648677.jpg"></p><p style="text-align: center;" align="center">&nbsp;</p><p style="text-align: center;" align="center">​&lt;발표 후 사단법인 피피엘 멘토들과의 사진&gt;</p><p style="text-align: center;" align="center"><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a90a87dbf718556707.jpg"></p><p style="text-align: center;" align="center">&nbsp;</p><p style="text-align: center;" align="center">​</p>', '1555017782134_219.jpg', '59a90a87dbf718556707.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:23:02', 6, NULL, NULL, NULL, 'http://h-ondream.kr/?p=4301', '', ''),
	(4, 2, NULL, NULL, '앤톡, 행정안전부 주관 공공데이터 사업화지원 대상 기업 최종 합격', '<p>앤톡이 정보화진흥원 공공데이터 활용기업 육성사업 2기에 최종 선정되었습니다.</p><p>&nbsp;</p><p>행정자치부는 3월 27일 "혁신적인 기술과 사업 아이템으로 무장한 신생 벤처기업(스타트업) 5곳이 정부의 공공데이터 창업지원 종합공간인 \'오픈스퀘어-D\'에 새로 입주한다"고 발표했습니다. 참여한 40여팀 중 최종 선발된 기업은 지속가능발전소(주), (주)이모션북스, (주)앤톡 등 3개 창업기업과 2개 예비창업팀이며, 입주에 성공한 앤톡(Antock)은 개인투자자를 위해 이용자가 검색한 주식종목에 대해 자동화된 방식으로 기업과 주식의 건강을 측정하고 문제사항을 시각적으로 도출해 제공하는 Fin-tech 스타트업입니다.​</p><p>&nbsp;</p><p style="text-align: center;" align="center"><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a90cffa6c6f1914139.jpg">​</p>', '1555017885415_362.jpg', '59a90cffa6c6f1914139.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:24:45', 1, NULL, NULL, NULL, '', '', ''),
	(5, 2, NULL, NULL, '박재준 앤톡 대표 인터뷰, \'그림책\'처럼 쉬운 증권 정보로 ‘묻지마 투자’ 줄이세요”', '<p>앤톡 Antock 창업의 이유, 그 첫 번째 이야기.</p><p>&nbsp;</p><p>"급하게 들른 공중 화장실 안에서 우연히 엿들은 대화. “OO산업 주식이 곧 대박이 난다는데..." 아랫배 힘주는 것도 잊은채 어느새 스마트폰 주식 매매 앱을 켜고 있는 나... 이런 허무맹랑한 \'묻지마투자\'를 막아주겠다는 핀테크 스타트업 앤톡 Antock, 그리고 세 창업자(박재준, 박영준, 전병주) 이야기입니다." - 비즈업 기사 中​&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>\r\n<div style="text-align: center;" align="center"><iframe width="560" height="315" src="https://www.youtube.com/embed/dhajjFIawNo" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen=""></iframe></div>', '1555018115237_148.png', '59a90ebb742bd4871801-225x170.png', NULL, NULL, NULL, NULL, '2019-04-11 21:28:35', 3, NULL, NULL, NULL, 'http://naver.me/5GsPwW2F', '', ''),
	(6, 2, '상공', NULL, '앤톡 우리은행 핀테크기업 육성사업 1기 최종 선정', '<p>"위비핀테크랩 1기로 입주를 확정한 스타트업은 앤톡, 매너카, 월세시대, 다움소프트, 비네핀, 한국신용데이터 등이다. 각각 로보어드바이저, 차량거래 플랫폼, 월세관리, 해외직구, 가계부, 신용평가모형 등을 사업 아이템으로 하는 핀테크 스타트업이다. 우리은행은 조만간 추가 선발 절차를 마무리하고 10개 내외의 스타트업과 함께 위비핀테크랩 1기를 꾸려갈 것이라는 입장이다." - 더벨 (the bell)</p><p>&nbsp;</p><p style="text-align: center; " align="center">&lt;주식회사 앤톡의 박재준 대표 | 출처: 우리은행 위비핀테크랩&gt;​&nbsp;</p><p style="text-align: center; " align="center"><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a9103c2f0108924225.jpg">​</p>', '1555018343635_960.jpg', '59a9103c2f0108924225.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:32:23', 0, NULL, NULL, NULL, '', '', ''),
	(7, 2, '상공', NULL, '코스콤, 앤톡 (Antock)과 \'공동핀테크 오픈플랫폼\' MOU 체결', '<p>"금융권 공동 핀테크 오픈플랫폼이 증권업계에서 새로운 바람을 몰고 올 수 있을지 주목된다. 코스콤은 11개 핀테크 기업과 공동으로 오픈API를 활용한 서비스 구축 사업을 진행하기 위한 업무협약을 맺었다고 7일 밝혔다." - ZDNet Korea</p><p>&nbsp;</p><p style="text-align: center; " align="center">&lt;정연대 코스콤 사장은 핀테크 기업인 앤톡 외 10곳과 MOU 체결&gt;​&nbsp;</p><p style="text-align: center; " align="center"><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a9135f8f31f5406717.jpg">​</p>', '1555018389916_982.jpg', '59a9135f8f31f5406717.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:33:09', 0, NULL, NULL, NULL, '', '', ''),
	(8, 2, NULL, NULL, '앤톡(Antock), 아리랑TV News Center 출연', '<p>앤톡이 공공데이터를 활용하는 스타트업 우수 사례로 아리랑TV 뉴스센터 프로그램에 소개되었습니다.</p><p style="text-align: center;" align="center">&nbsp;</p><p style="text-align: center;" align="center">&lt;앤톡 박재준 대표와 박영준 이사 인터뷰 영상&gt;​&nbsp;</p><p style="text-align: center;" align="center">&nbsp;</p>\r\n<div style="text-align: center;" align="center"><iframe width="560" height="315" src="https://www.youtube.com/embed/UMhIuU_PVNM" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen=""></iframe></div><div style="text-align: center;" align="center"><br></div><div style="text-align: center;" align="center"><br></div><div style="text-align: left;" align="left">Have you ever wondered where you left your bag, an important piece of equipment, or whether your child has got to school safely?</div><div align="left">Well, there\'s an app for that. One Korean tech company uses government-supplied data to help you pin down the exact address and location of the person or property in question. All you need is your smartphone or a tracking device. "Buying maps and address data from other companies was quite a burden and undependable at times. But now we get the data for free on steady terms. It saves us 10 to 20% of our operating costs."</div><div align="left"><br></div><div align="left">In 2013, the Korean government launched an intiative called Government 3.0, unlocking data in key sectors of public interest like health, transportation and real estate. Having released more than 17-thousand data sets for 6-hundred and sixty-one agencies, Korea ranks first among OECD member countries in terms of data openness. However, a study found that since the initiative began three years ago, only 5 percent of that information was used to develop new products and services.</div><div align="left">To encourage more usage of the data, there has been a shift of focus from increasing the quantity of open data to enhancing its overall quality.</div><div align="left"><br></div><div align="left">"Data institutions need to supply data from the perspective of the user, considering accessibility. Another important factor is standardization. Without it, data from different sources cannot interlink, which is very inconvenient. When data links, that creates value. So the government is currently working on that."</div><div align="left"><br></div><div align="left">Also, an incubation center was established this year to help start-ups build their businesses on data. "Most of those using open data are single-person businesses, start-ups and small companies. We found that what they need most, after data, is the physical space to develop their ideas.\'" Start-ups can receive comprehensive support, from business courses, consultations to one-on-one mentoring sessions. There\'s also a strong synergy effect as they can bounce ideas and tips off each other.</div><div align="left"><br></div><div align="left">Antock is one such company. It\'s a fintech startup that provides securities information in a visual way that\'s easy to understand. "There\'s clearly a limit to how much an investor can digest and apply securities information when making an investment decision. What we do is evaluate the company\'s financial performance and stock performance. So all they have to do is come to our website and type in the company name." Users can spot the various risks of a company through colorful infographics, and look up financial jargon that\'s carefully explained.</div><div align="left"><br></div><div align="left">"There were companies that sold financial data but now that we have direct access to the source, it reduces our dependency on other businesses and adds to our competitive edge. Most of all, it\'s cost-effective." It\'s not just the private sector that can maximise the benefits of data. In countries like the UK and the US, which rank high in terms of utilisation, data is also used by civic groups and public institutions to improve government policies.</div><div align="left"><br></div><div align="left">"We\'ve got lots of different intermediary groups who are active. We\'ve benefited a lot from a lot of good social interaction between civil servants working on policy areas, a gathering of government, civil society, private sector to discuss how to make government work better. It\'s important to build the links of trust and interaction."</div><div align="left"><br></div><div align="left">With more and more data being opened, promising unlimited possibilities, there are more opportunities for both the public and private sectors to convert data into ideas and ideas into impact.</div><div align="left"><br></div><div align="left">Oh Soo-young, Arirang News.</div><div style="text-align: left;" align="left">Reporter : osy@arirang.co.kr​<br></div>', '1555018598215_281.jpg', '59a91b58552229147357-225x170.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:35:34', 1, NULL, NULL, NULL, 'http://www.arirang.com/News/News_View.asp?nseq=195217', '', ''),
	(9, 2, '상공', NULL, '앤톡, 2016 소프트웨어대전 스타트업 경진대회 우수상 수상', '<p>앤톡(Antock)이 K-ICT 본투글로벌과 전자시문이 공동주최한 \'제1회 소프트웨이브 스타트업 경진대회\'에서 3위에 오르며 우수상을 수상하였습니다.</p><p>&nbsp;</p><p>SoftWave 2016 스케일업 경진대회는 우수한 스타트업을 발굴하여 시상하는 행사이며, 올해 처음으로 전자신문과 K-ICT 본투글로벌센터가 공동 주최했습니다. 총 13개 창업기업이 참가해 자사 솔루션과 서비스를 오전 팀별 발표를 통해 설명했습니다. 심사위원 7명 중 5명이 외국인이었으며, 싱가포르·홍콩·영국·호주 투자기관 전문가가 심사위원으로 참여했습니다.</p><p>&nbsp;</p><p>&lt;SoftWave 2016 주식회사 앤톡 Antock Co., Ltd. 홍보 부스 사진&gt;​&nbsp;</p><p><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a91d3e8d4fd9485254.jpg">​</p><p>&nbsp;</p><p>&lt;박영준 CMO가 앤톡(Antock)의 사업 모델과 서비스를 소개하는 모습&gt;&nbsp;</p><p><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a91d3e913a52278055.jpg">​</p><p>&nbsp;</p><p>&lt;싱가포르·홍콩·영국·호주·한국 투자기관 전문가 7명이 심사하는 모습&gt;&nbsp;</p><p><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a91d3e948ee2395159.jpg">​</p><p>&nbsp;</p><p>&lt;소프트웨어대전 SoftWave 2016 스타트업 경진대회에서 우수상을 수상한 앤톡 Antock&gt;&nbsp;</p><p><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a91d3e9ad897519750.jpg">​</p><p>&nbsp;</p><p>&lt;수상자 및 심사위원과 찍은 단체 사진&gt;&nbsp;</p><p><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a91d3e9e2041507909.jpg">​</p>', '1555018741060_989.jpg', '59a91d3e913a52278055.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:39:01', 0, NULL, NULL, NULL, 'http://www.etnews.com/20160928000247', 'http://www.etnews.com/20160926000376', 'http://www.etnews.com/20160921000226'),
	(10, 2, NULL, NULL, '앤톡, 코스콤 \'Open-API 플랫폼 기반 핀테크 서비스 공모전\' 장려상 수상', '<p>지난 24일, 코스콤(KOSCOM)이 주최한 ‘오픈API(Application Programming Interface) 플랫폼 기반 핀테크 서비스 공모전’에서 장려상을 수상했습니다. 이날 대상을 비롯한 최우수상, 우수상 그리고 장려상까지 총 11개 기업이 수상했습니다.</p><p>&nbsp;</p><p>정연대 코스콤 사장은 이날 시상식에서 “금융권 공동 핀테크 오픈플랫폼 활성화 차원에서 본선에 진출한 11개 기업 모두를 수상자로 선정했다”면서 “서비스의 우수성은 물론 향후 성장가능성 등을 함께 고려한 결과로 핀테크 산업에 보탬이 되길 바란다”고 말했습니다.</p><p>&nbsp;</p><p>기사 출처: 헤럴드경제 문영규 기자 <a href="http://news.heraldcorp.com/view.php?ud=20161024000645​">http://news.heraldcorp.com/view.php?ud=20161024000645​</a>&nbsp;</p><p>&nbsp;</p><p style="text-align: center; " align="center">&lt;앤톡의 박재준 대표 사진 첫번째 줄 오른쪽 끝에 위치 | 출처: 코스콤&gt;&nbsp;</p><p style="text-align: center;" align="center"><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a91f1d70fc37507442.jpg">​</p>', '1555018871745_595.jpg', '59a91f1d70fc37507442.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:41:11', 0, NULL, NULL, NULL, '', '', ''),
	(11, 2, NULL, NULL, '로보어드바이저 스타트업 \'앤톡\' 박재준 대표 인터뷰', '<p>&lt;박재준 대표 인터뷰 내용 지면 게재&gt;&nbsp;</p><p><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a91fcf339e85943703.jpg"></p><p>&nbsp;</p><p>앤톡이란 회사 이름은 \'개미(Ant)\'와 \'주식(Stock)\'을 버무려 만들었다. 이름 그대로 개미투자자들에게 주식 정보를 제공하는 스타트업이다.</p><p>"개인투자자들이 보다 건전한 방식으로 투자할 수 있게 돕고 있어요. 재무제표처럼 간과하기 쉬운 정보를 분석해 이해하기 쉽도록 글이나 인포그래픽 등으로 만들어 제공하는 거죠."</p><p>&nbsp;</p><p>앤톡은 전문용어와 숫자의 나열이었던 주식 정보를 한눈에 알 수 있도록 그림책처럼 쉽게 재가공해 웹사이트에서 무료로 제공하고 있다. 앤톡의 사업 모델은 한국사회적기업진흥원과 한국정보화진흥원의 투자, 코스콤 등의 무료 데이터 지원 등의 성과를 일궈냈다.</p><p>&nbsp;</p><p>박 대표가 앤톡 창업을 결심하게 된 계기는 무엇이었을까. "컨설팅을 하다 보니 새로운 관점을 제시하는 것에 한계를 느꼈어요. 세상에 새로운 가치를 만들고 새로운 관점을 제시하기 위해서는 회사를 만드는 수밖에 없겠다는 생각이 들었죠. 창업을 결심하는데 있어서는 제 성향도 크게 작용했어요. 돈이나 사회적 지위를 쫓는 것보다는 창조적인 일을 할 때 즐거움을 느끼거든요."​​</p>', '1555018961648_265.jpg', '59a91fcf339e85943703.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:42:34', 0, NULL, NULL, NULL, 'http://www.asiatime.co.kr/news/articleView.html?idxno=140659', '', ''),
	(12, 2, NULL, NULL, '앤톡(Antock) 우리은행 위비핀테크 Lab 1기 데모데이 참석', '<p>지난 27일, 주식회사 앤톡 (Antock Co., Ltd.)이 우리은행 \'위비핀테크Lab 데모데이\'에 참석하여 우리은행의 위비 플랫폼 상에 ASEAN지역 상장주식 분석 솔루션을 탑재하는 방안을 제안하였습니다.</p><p>&nbsp;</p><p style="text-align: center; " align="center">&nbsp;</p><p style="text-align: center;" align="center">&lt;데모데이에서 발표하는 앤톡의 박영준 이사 영상 | 출처: 우리은행 핀테크 사업부&gt;</p><p style="text-align: center;" align="center">\r\n<iframe width="560" height="315" src="https://www.youtube.com/embed/uS_TrwKlzgE" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen=""></iframe>\r\n&nbsp;</p><p style="text-align: center; " align="center">&nbsp;</p><p style="text-align: center;" align="center">&lt;데모데이에 참석한 우리은행 위비핀테크랩 1기 출신 기업 대표들의 단체 사진 | 출처: 우리은행 핀테크 사업부&gt;​&nbsp;</p><p><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a92305879085259164.jpg">​</p>', '1555019085915_53.jpg', '59a92333a733c9101715-225x170.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:44:24', 0, NULL, NULL, NULL, '', '', ''),
	(13, 2, '상공', NULL, '그림책처럼 쉬운 증권정보 펼쳐보기', '<p style="text-align: center; " align="center">&lt;앤톡의 박재준 대표 인터뷰 내용 전자신문 지면 게재&gt;</p><p style="text-align: center; " align="center"><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a9243315f5f4285839.jpg">​</p><p>&nbsp;</p><p>"개인투자자에게 증권 분석은 힘들다. 복잡한 도표, 그래프 등 각종 데이터를 모아 분석해야 하기 때문이다. 낭패를 보지 않으려면 오랜 기간 전문 지식을 쌓고 공부해야 한다. 이 과정에서 시행착오를 겪기도 한다. 기업 성장 가능성과 위험요소를 꼼꼼히 분석한 뒤 투자하는 가치투자를 쉽게 따라 하기 어려운 이유다.</p><p>&nbsp;</p><p>회사명 앤톡도 개인투자자를 상징하는 개미(Ant)와 주식(Stock) 합성어다. `그림책처럼 쉬운 증권정보`를 목표로 2015년 10월 설립됐다. 박재준 대표는 “5년 동안 금융 전략 컨설팅 쪽에서 일하면서 500만명에 달하는 국내 개인투자자에게 친화적 증권 정보가 적다는 것을 알았다”고 말했다. 박 대표는 “전문가가 아니라 개인투자자 눈높이에 맞추면 건전한 방식의 개인투자가 이뤄질 것이라 판단해 창업을 결심했다”고 설명했다." - 전자신문 오대석 기자​&nbsp;</p>', '1555019210193_338.jpg', '59a9244140d797118847-225x170.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:46:50', 0, NULL, NULL, NULL, 'http://www.etnews.com/20170221000133', '', ''),
	(14, 2, '상공', NULL, '“아직 수익도 휴일도 없지만 두고 보세요, 진짜 회사 만들 겁니다”', '<p>앤톡의 창업 스토리를 담은 경향신문 기사입니다.</p><p>&nbsp;</p><p>"...특히 지난해 1분기는 ‘암흑기’였다. 사무실도 구하지 못해 커피숍 등을 전전했다. 그러다 겨우 센터에 입주했다. 무료 입주 기간이 끝나면 이 회사는 어떻게 될까. 박 대표는 말했다. “앞으로 1년 후에도 (유료) 사무실 못 낼 정도면 뭔가 구조적으로 문제가 있는 회사인 거죠. 그렇게 되지는 않을 겁니다. 두고 보세요.” 그의 사무실은 밤 11시가 넘도록 불이 꺼지지 않았다." - 경향신문 홍재원 기자</p><p>&nbsp;</p><p style="text-align: center; " align="center">&lt;경향신문 2017년 5월 13일 A12면에 게재된 앤톡 인터뷰 내용&gt;​&nbsp;</p><p style="text-align: center; " align="center"><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a926da42a2a1493235.jpg">​</p>', '1555019271664_315.jpg', '59a927382e86e5181451-225x170.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:47:51', 0, NULL, NULL, NULL, 'http://biz.khan.co.kr/khan_art_view.html?artid=201705122110005&code=920507', '', ''),
	(15, 2, '상공', NULL, '행정안전부 주관 Open Data Forum(ODF) 발대식 참석한 앤톡', '<p>공공데이터를 활용해 사회문제를 해결하기 위해 정부, 시민사회, 기업, 학계가 함께한 포럼. 앤톡이 공공데이터 활용기업 대표로 세레모니에 참여했습니다.</p><p>&nbsp;</p><p style="text-align: center; " align="center">&lt;김부겸 행정안전부 장관을 비롯한 ODF 관계자와 앤톡의 박영준 이사 단체 기념촬영&gt;</p><p style="text-align: center; " align="center"><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a9290ae11021206210.jpg">​</p><p style="text-align: center; " align="center">&nbsp;</p><p style="text-align: center; " align="center">&lt;오픈데이터포럼 발대식에 참석한 김부겸 행정안전부 장관과 박영준 앤톡 이사 사진&gt;​&nbsp;</p><p style="text-align: center; " align="center"><img src="http://antock.com/wp-content/uploads/kboard_attached/2/201709/59a9290adac035955623.jpg">​</p>', '1555019347187_820.jpg', '59a9290adac035955623.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:49:07', 0, NULL, NULL, NULL, 'http://www.yonhapnews.co.kr/photos/1990000000.html?cid=PYH20170727438900013&input=1196m', '', ''),
	(16, 2, NULL, NULL, '(주)앤톡 우리은행 데모데이 발표', '<p>우리은행 위비핀테크랩 주관 두 번째 데모데이에서 (주)앤톡의 박재준 대표가 앤톡의 기업 경쟁력 및 사업 진행 현황을 소개하는 모습이다.</p><p>&nbsp;</p>\r\n\r\n<div style="text-align: center;" align="center"><iframe width="560" height="315" src="https://www.youtube.com/embed/5s6Fez0JNoc" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen=""></iframe></div>', '1555019516118_473.jpg', '5a3cae2ae373e2229919.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:51:56', 0, NULL, NULL, NULL, '', '', ''),
	(17, 2, NULL, NULL, '빅데이터 기반 금융분석 핀테크 기업, \'앤톡 (Antock)\' 한국경제TV 출연', '<p style="text-align: center;" align="center"><iframe width="560" height="315" src="https://www.youtube.com/embed/VqprFSRp9-4" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen=""></iframe></p><p style="text-align: center;" align="center">&nbsp;</p><p>&nbsp;</p><p>출연 박재준 앤톡 대표</p><p>&nbsp;</p><p>진행 엄지민 캐스터 안건희</p><p>&nbsp;</p><p>구성 최현송</p><p>&nbsp;</p><p>연출 임상우</p><p>&nbsp;</p><p>조연출 박별</p><p>&nbsp;</p><p>[영상 출처: 한국경제TV]​&nbsp;</p>', '1555019586377_157.jpg', '5acb330619bff7355590.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:53:06', 2, NULL, NULL, NULL, '', '', ''),
	(18, 2, '상공', NULL, '비상장 주식 관심 높아지는데...정보는 어디에 - 한국경제TV 뉴스', '<div style="text-align: center;" align="center"><iframe width="560" height="315" src="https://www.youtube.com/embed/iPrtSnfkwTg" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen=""></iframe></div><p>&lt;앵커&gt;</p><p>&nbsp;</p><p>비상장 주식 시장에 대한 관심이 점점 커지고 있습니다. 문제는 상장 기업이 아닌 만큼 투자 정보가 부족하다는 점인데요. 그렇다면 반대로 정확한 장외주식 정보를 모으고 분석할 수 있다면 이 시장에서 유리한 위치에 있을 수 있다는 얘기도 될 겁니다.</p><p>&nbsp;</p><p>비상장 기업을 둘러싼 정보전의 서막, 신인규 기자가 취재했습니다.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&lt;기자&gt;</p><p>&nbsp;</p><p>국내 한 스타트업이 개발한 인공지능 기반 장외주식 전용 엔진 \'스타파인더\'입니다.</p><p>&nbsp;</p><p>관심있는 비상장 기업을 검색하면, 아이언맨의 만능 인공지능 비서 \'자비스\'처럼 필요한 정보를 자동으로 모읍니다.</p><p>&nbsp;</p><p>비상장기업인 현대오일뱅크를 클릭하면 이 기업의 재무제표를 분석해 현재 코스닥과 코스피에 상장이 가능한 기업인지를 알려줍니다.</p><p>&nbsp;</p><p>재무정보 뿐 아니라 이를 근거로 한 상장 가능성, 주가 잠재성, 기업 경쟁력을 비교해 보여주는 기능도 갖췄습니다.</p><p>&nbsp;</p><p>지표와 숫자를 기반으로 하는 \'퀀트 투자\' 방식의 전략을 비상장 기업에도 적용할 수 있는 겁니다.</p><p>&nbsp;</p><p>&lt;인터뷰&gt;박재준 앤톡 대표</p><p>&nbsp;</p><p>"주가 적정성 경우에는 해당 비상장 주식과 가장 유사한 상장기업을 추출해 그들의 가치배수를 역으로 적용해 적정 주가 범위를 산출하고요. 상장 가능성의 경우 비상장기업 재무정보나 속성 정보를 파악해 상장요건을 얼마나 충족시키고 있는지를 알려줍니다."</p><p>&nbsp;</p><p>흩어진 정보들을 모으고 비교하는 것만으로도 이른바 \'깜깜이 투자\'나 \'묻지마 투자\'를 막을 수 있다는 취지인데, 현재 이 엔진은 K-OTC와 코넥스에도 오르지 않은 기업 200여곳을 포함해 460개 비상장 기업에 대한 데이터베이스를 확보해놓았습니다.</p><p>&nbsp;</p><p>비상장주식 거래 시장에 대한 관심이 커지고 점점 더 많은 자금이 투입되는 것과 맞물려, 이처럼 개인투자자들을 위한 재무정보 공개 움직임들이 생겨나는 것은 주목할 만한 부분입니다.</p><p>&nbsp;</p><p>사설 장외주식 거래소 등에서 흘러나오는 루머는 대개 이해관계자들로부터 발생하는 만큼 기업 펀더멘털과 관련없는 것들이 많기 때문입니다.</p><p>&nbsp;</p><p>하반기 IPO 대어로 꼽히며 비상장 주식 거래가 활발히 이뤄졌다 예상치 않게 감사의견 \'한정\'을 받으며 상장 일정이 무산된 젠바디의 사례는, 비상장기업에 대한 \'묻지마 투자\'의 위험성을 보여줍니다.</p><p>&nbsp;</p><p>코스닥·코스피 시장 상장을 위한 성장 사다리라는 비상장 주식시장의 역할을 제대로 해내기 위해서도, 비상장 기업에 대한 체계적인 정보 분석 시스템에 대한 중요성은 앞으로 더 커질 전망입니다.</p><p>&nbsp;</p><p>한국경제TV 신인규입니다.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>영상 및 기사 출처: [한국경제TV]</p><p>&nbsp;</p><p>&nbsp;</p><p>장외주식 분석 솔루션 이용 방법 : SF.WOWSTAR.CO.KR​&nbsp;</p>', '1555019683556_94.jpg', '5b0f7e70997291179351.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:54:43', 1, NULL, NULL, NULL, '', '', ''),
	(19, 2, '상공', NULL, '행안부, 혁신제품 및 서비스 우수사례 ..., 금융부문 앤톡 선정', '<p>"... 국내·외 상장 및 비상장 기업 분석 서비스를 제공하는 ‘앤톡닷컴’ 등 정부가 공공데이터를 활용해 창업에 성공한 기업들의 성공사례를 담은 사례집을 발간했다.</p><p>&nbsp;</p><p>행정안전부와 한국정보화진흥원은 공공데이터를 활용, 혁신적인 제품 및 서비스를 개발하고 탁월한 성과를 창출한 창업 성공기업 33개 우수사례를 소개했다.</p><p>&nbsp;</p><p>...(생략)</p><p>&nbsp;</p><p>■ 앤톡, 금융 분석에 대한 새로운 관점 제시한다</p><p>&nbsp;</p><p>앤톡은 개인 투자자 대상 증권 및 기업 정보를 시각화해 제공하는 전문 핀테크 스타트업이다. 사명은 개인 투자자를 상징하는 개미(Ant)와 주식(Stock)의 합성어로, ‘앤톡닷컴’을 통해 국내·외 상장 및 비상장 기업 분석 서비스를 제공하고 있다. 앤톡은 서비스 제공을 위해 공공데이터포털(data.go.kr), 금융감독원, 한국증권거래소, 예탁결제원 등으로부터 확보한 각종 공공데이터를 적극 활용했으며 그 결과, 2017년 연말까지 약 1억5,000만원의 매출을 달성했다.</p><p>&nbsp;</p><p>행안부는 앞으로도 국민과 기업이 실제 필요로 하는 공공데이터 개방을 확대하고, 경제·사회·문화 등 다방면에서 국민 실생활에 공공데이터가 새로운 가치 창출에 적극 지원한다는 방침이다."</p><p>&nbsp;</p><p>기사 출처: 국토일보 하종숙 기자</p><p>&nbsp;</p><p>Related Articles:&nbsp;</p><p>&nbsp;</p><p>보안뉴스 "공공데이터 활용한 창업 성공 비밀이 궁금하다면?"</p><p>&nbsp;</p><p>아이티데일리 "행안부, 공공데이터 활용한 33개 창업 우수사례 공개"</p><p>&nbsp;</p><p>정책브리핑 "행안부, 공공데이터 활용 창업 성공 비밀 전격 공개"</p><p>&nbsp;</p><p>디지털타임즈 "공공데이터 활용실적 4년새 5배 급증"​&nbsp;</p>', '1555019737821_584.jpg', '5b0f7f21720096640655.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:55:37', 2, NULL, NULL, NULL, '', '', ''),
	(20, 2, '상공', NULL, '우리은행과 함께가는 핀테크 스타트업, (주)앤톡', '<div style="text-align: center;" align="center"><iframe width="560" height="315" src="https://www.youtube.com/embed/UbKA4_moB5M" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen=""></iframe></div><p>&nbsp;</p><p>위비크라우드 플랫폼 개발 프로젝트에 참여하는 앤톡의 창업 스토리&nbsp;</p><p>&nbsp;</p><p>영상 출처: 우리은행 홍보실​&nbsp;</p>', '1555019816399_269.jpg', '5b1775b6b027f4407684.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:56:56', 4, NULL, NULL, NULL, '', '', ''),
	(21, 2, '상공', NULL, '중소벤처신문 스타트업 CEO 36번째 인터뷰, 앤톡(Antock)', '<p>[스타트업CEO#36] 2년 만에 무섭게 성장한 핀테크 스타트업 \'앤톡\'</p><p>2015년 10월 설립된 핀테크 스타트업 앤톡의 핵심 키워드는 ‘금융’ ‘분석’ ‘시각화’다. 앤톡은 금융, 증권, 기업에 대한 데이터를 취합·분석·평가한다. 자동화된 기술력을 기반으로 투자 정보를 제공하는 로보 어드바이저 기술력도 보유하고 있다.</p><p>&nbsp;</p><p>&nbsp;</p><p>앤톡(Antock)이라는 사명은 개인 투자자를 상징하는 개미(Ant)와 주식을 지칭하는 스톡(Stock)의 합성어다. 회사는 개인 투자자 중심의 금융 정보를 대중에게 제공하는 것을 목표로 한다. 상장, 장외(비상장), 스타트업, 그리고 ASEAN 상장 기업들에 대한 분석 정보를 제공한다. 이용자가 검색하는 기업에 대하여 9가지 영역별로 40개 이상의 지표를 자동 진단해 해당 기업 또는 주식의 건강 상태와 투자 매력도를 평가한다.</p><p>&nbsp;</p><p>&nbsp;</p><p>또한 기업에 대한 평가 결과를 수치 중심이 아닌 누구나 이해할 수 있는 시각화 된 인포그래픽 및 이미지 콘텐츠 형태로 변환하여 제시함으로써 재무 지식이 높지 않더라도 좋은 기업은 쉽게 알아보고 부실한 기업은 피해갈 수 있게 지원한다.</p><p>&nbsp;</p><p>&nbsp;</p><p>...(생략)</p><p>&nbsp;</p><p>&nbsp;</p><p>기사 출처: 중소벤처신문, 신지민 기자​&nbsp;</p>', '1555019865811_398.jpg', '5c06436339b694722991.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:57:45', 16, NULL, NULL, NULL, 'http://www.joongven.com/news/view.php?no=4261', '', ''),
	(22, 2, NULL, NULL, '마포비즈플라자 우수기업으로 앤톡 선정', '<p>"개미투자자, 이제 쉽고 합리적으로 투자하세요"</p><p>&nbsp;</p><p>500만명. 주식시장에서 소위 \'개미\'라고 불리는 개인투자자들의 숫자다. 서울시 인구의 절반에 해당하는 개미들이 워런 버핏과 같은 주식부자, 즉 \'슈퍼개미\'를 꿈꾼다. ​&nbsp;</p><p>&nbsp;</p><p style="text-align: center; " align="center"><img src="http://antock.com/wp-content/uploads/2018/12/JJP-at-Woori-Bank-1.jpg">​</p><p>&nbsp;</p><p>박재준(사진) 앤톡(Antock) 대표는 "개인투자자 중에 재무제표분석을 통해 건전하고 과학적으로 투자하는 사람이 생각보다 적다"며 "금융·증권 정보가 전문적이어서 어렵다 보니 소리 소문에 투자하거나 \'묻지마 투자\'가 대부분이다. 이는 (주식 투자) 사고나 피해로 이어지는 경우가 많다"고 지적했다.</p><p>&nbsp;</p><p>앤톡은 개인투자자를 상징하는 개미(Ant)와 주식(Stock)의 합성어다. 개인투자자에게 친화적인 금융 콘텐츠 및 기업 정보를 제공하는 핀테크 스타트업이다.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>...(생략)</p><p>&nbsp;</p><p>기사 출처: 머니투데이, 장경석 기자​&nbsp;</p><p><span id="husky_bookmark_end_1555019930085"></span>&nbsp;</p>', '1555020008234_751.jpg', '5c0645a8aed094802093.jpg', NULL, NULL, NULL, NULL, '2019-04-11 21:59:26', 0, NULL, NULL, NULL, 'http://news.mt.co.kr/mtview.php?no=2018061914197471778', '', ''),
	(23, 2, NULL, NULL, '국내 최초 쌍방향 리서치 플랫폼 ‘마이리서치하우스’, 앤톡과 공동사업 계약 체결', '<p><img src="http://antock.com/wp-content/uploads/2018/12/screencapture-antock-myresearchhouse-company-view-2018-12-04-19_08_12.png">​</p><p>&nbsp;</p><p>국내 최초 쌍방향 리서치 플랫폼 ‘마이리서치하우스’(이하 마리하)가 베타서비스를 성황리에 마치고 오늘(5일)부터 공식 오픈한다고 밝혔다.</p><p>&nbsp;</p><p>지난달 22일 웹과 안드로이드 애플리케이션 공개 베타서비스를 시작했던 ‘마리하’는 베타서비스에 이어 플랫폼을 공식 오픈했다.</p><p>&nbsp;</p><p>네이버, 카카오와 같은 대기업에서부터 1인 블로거까지 곳곳에서 주식투자정보를 제공하고 있고 SNS를 통해서도 수많은 정보와 성공투자방법에 대한 이야기가 넘쳐나지만 주식투자인구 2천만 명 시대의 절대다수 투자자들은 여전히 막막함에서 벗어나지 못하고 있다</p><p>&nbsp;</p><p>...(생략)</p><p>&nbsp;</p><p>뿐만 아니라 마이리서치하우스는 지난 1일 행정안전부 금융부문 혁신 서비스 우수사례 업체로 선정된 ㈜앤톡과 업무협약을 체결함에 따라 멤버십 회원들은 11월 중으로 개시될 ㈜앤톡의 혁신적인 종목진단 서비스를 무료로 사용할 수 있다.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>기사 출처: 전자신문, 신지선 기자​&nbsp;</p>', '1555022167231_51.jpg', '5c06527961b401607543.jpg', NULL, NULL, NULL, NULL, '2019-04-11 22:01:16', 6, NULL, NULL, NULL, 'http://www.etnews.com/20181105000460', '', ''),
	(24, 2, '상공', NULL, '앤톡, 베트남 IT기업 VietSoftware International Inc,와 MOU 체결', '<p>(주)앤톡은 국내 핀테크 기업 동남아 진출을 지원하고 있는 한국인터넷진흥원(KISA)의 \'핀테크 글로벌 비즈니스 상담회\' 참가 기업으로 선정되었습니다.</p><p>&nbsp;</p><p style="text-align: center; " align="center"><img src="http://antock.com/wp-content/uploads/2018/12/DZM_8405.jpg">​</p><p style="text-align: center; " align="center">&nbsp;</p><p style="text-align: center; " align="center"><img src="http://antock.com/wp-content/uploads/2018/12/DZM_8411.jpg">​</p><p>&nbsp;</p><p>&nbsp;</p><p>공모를 통해 선정된 국내 9개 핀테크 기업이 상담회에 참가했으며, 현지 지급결제대행(PG) 등 금융업에 전문성을 지닌 인도네시아 18개사, 베트남 24개사를 대상으로 IR 피칭과 일대일 미팅이 진행됐습니다. 그 결과 앤톡은 베트남 IT기업인 Vietsoftware International Inc., 와 MOU를 체결했으며 향후 베트남 진출을 위해 양사가 긴밀히 협력하기로 약속했습니다​&nbsp;</p>', '1555020186625_181.jpg', 'DZM_8411.jpg', NULL, NULL, NULL, NULL, '2019-04-11 22:03:06', 44, NULL, NULL, NULL, 'https://www.yna.co.kr/view/AKR20181202021500017?input=1195m', 'http://www.inews24.com/view/1143028', ''),
	(25, 1, NULL, NULL, '(주)앤톡, \'2018 공공 빅데이터 성과공유대회\' 장관상 수상', '<p>&nbsp;</p><p><img src="http://antock.com/wp-content/uploads/2019/02/nia_antock.jpg">​▲(주)앤톡 박재준 대표(우)가 \'2018 공공 빅데이터 성과공유대회\'에서 공공데이터 활용 분야 유공 장관 표창을 받고 있다.</p><p>&nbsp;</p><p>&nbsp;</p><p>행정안전부 주관 `2018 공공 빅데이터 성과공유대회`에서 주식회사 앤톡이 민간분야 공공데이터 관련 유공자 장관 표창을 수상했다고 밝혔다</p><p>앤톡(Antock)은 2015년에 설립돼 한국경제TV와의 `국내 장외 주식 분석 솔루션` 공동사업 체결, 우리종합금융 및 골든브릿지투자증권과의 크라우드펀딩 플랫폼 개발, 공공기관과의 스타트업 통합 관리 및 분석 프로젝트 진행, 국내외 기업과의 MOU 체결 등의 실적을 통해 사업 영역을 구축해왔다.</p><p>&nbsp;</p><p>&nbsp;</p><p>앤톡 박재준 대표는 "Big Data 및 AI 기술력을 기반으로 방대한 금융 데이터를 자체적으로 확보한 후 가치 투자 분석을 결합하여 `금융 분석 시각화 (Visual Finance) 엔진`을 자체 개발하였다"고 말했다. 박대표는 "국내외에서 건전한 투자 문화 조성을 수행하는데 이바지하겠다"고 밝혔다.</p><p>&nbsp;</p><p><img src="http://antock.com/wp-content/uploads/2019/02/nia_antock-2.jpg"></p><p>▲\'2018 공공 빅데이터 성과공유대회\'에서 공공데이터 유공 장관 표창 수상 수 (주)앤톡 박재준 대표(좌)와 임직원의 모습이다.</p><p>&nbsp;</p>', '1555020321539_296.jpg', '5c5beb8fa50a13205505.jpg', '', '', NULL, NULL, '2019-04-11 22:04:49', 23, NULL, NULL, '1', 'http://news.wowtv.co.kr/NewsCenter/News/Read?articleId=A201901310553&t=NN', '', ''),
